import React from 'react';

class PreNavbar extends React.Component {
    render() {
        return (
            <div className="prenavbar">
                <i className="user fa fa-user"></i>
                <i className="more fa fa-align-justify"></i>
            </div>
        );
    }
}

export default PreNavbar;
